    <title>Names</title>

    <link rel="stylesheet" href="css/awesomplete.css">

    <script src="js/utils.js"></script>
    <script src="js/awesomplete.js"></script>
    <script src="https://d3js.org/d3.v4.min.js"></script>
    <script src="https://d3js.org/d3-queue.v3.min.js"></script>
    <script src="https://unpkg.com/topojson-client@3"></script>
    <script src="https://momentjs.com/downloads/moment.min.js"></script>

    <style>

        body {
          padding: 0;
          margin: 0;
          background: #E8E8E8;
        }

        div.tooltip {
          position: absolute;
          max-width: 300px;
          padding: 3px 6px;
          color: grey;
          font-family: 'Overpass Mono', monospace;
          font-size: .7em;
          background: whitesmoke;
          border: 1px solid grey;
          border-radius: 3px;
          pointer-events: none;
        }

        /*bar-chart*/
        #bar-chart {
          transform: translate(500px, 480px);
        }

        .bar {
          fill: #31a354;
        }

        /*Map background*/
        #map-background {
          fill: #E8E8E8;
          /*fill: blue;*/
          stroke: none;
          width: 1000px;
          height: 600px;
          transform: translate(0,0);
        }

        /*States*/
        #states {
          transform: translate(-20px, -20px);
        }

        .state {
          stroke: #696969;
          stroke-width: 1;
        }

        /*Legend*/

        #search-widget-wrapper {
          position: absolute;
          top: 366px;
          left: 812px;
          display: none;
        }

        .name-input {
          font-family: 'Montserrat', sans-serif;
          padding:3px;
          width: 125px;
          text-align: center;
          width: 128px;
          height: 22px;
          font-size: 1em;
          font-weight: bold;
          border: 0;
        }

        .name-input-edit {
          border: 1px solid #696969;
          font-family: sans-serif;
          padding: 3px;
          width: 128px;
          height: 22px;
          text-align: left;
        }

        .switch-field {
          font-family: 'Montserrat', sans-serif;
          padding: 0;
        	overflow: hidden;
          position: absolute;
          top:400px;
          left:820px;
          display: none;
        }

        #legend {
          fill: #696969;
          font-size: .7em;
          transform: translate(785px, 360px);
        }

        .legend-text {
          fill: #000000;
          text-anchor: middle;
          font-family: 'Arimo', sans-serif;
        }

        .legend-title {
          font-size: 1.4em;
          font-weight: bold;
        }

        .legend-subtitle {
          font-size: 1.3em;
        }

        .legend-subsubtitle {
          font-size: 1.1em;
        }

        .label {
          fill: #000000;
          font-family: 'Overpass Mono', monospace;
        }

        .swatch {
          stroke: #696969;
          stroke-width:.3;
        }

        .icon {
          fill: #696969;
        }

        .legend-rect {
          fill: #ffffff;
          fill-opacity: 1;
          stroke-width: .3;
          stroke: #696969;
          rx: 5;
          ry: 5;
        }

        #map-wrapper {
          position:absolute;
          width: 1000px;
          height: 600px;
        }

        #edit-box {
          fill: #ffffff;
          stroke-width: 0;
          rx: 5;
          ry: 5;
        }

        #shuffle-box {
          fill: #ffffff;
          stroke-width: 0;
          rx: 5;
          ry: 5;
        }

        /*d3 slider*/
        .ticks {
          font: 10px sans-serif;
        }

        .track,
        .track-inset,
        .track-overlay {
          stroke-linecap: round;
        }

        .track {
          stroke: #000;
          stroke-opacity: 0.3;
          stroke-width: 10px;
        }

        .track-inset {
          stroke: #ddd;
          stroke-width: 8px;
        }

        .track-overlay {
          pointer-events: stroke;
          stroke-width: 50px;
          stroke: transparent;
        }

        .handle {
          fill: #fff;
          stroke: #000;
          stroke-opacity: 0.5;
          stroke-width: 1.25px;
        }

    </style>
</head>
